" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Gastrointestinal manifestations of systemic sclerosis (scleroderma)",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?40/35/41529/contributors\">",
