var title_f40_35_41530="Phosphorus foods 1 PI";
var content_f40_35_41530=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F79877%7EPI%2F56081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F79877%7EPI%2F56081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Table 20. Phosphorus content of protein-containing foods",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 413px; height: 694px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 497px\">",
"   <div class=\"ttl\">",
"    Table 20. Phosphorus content of protein-containing foods (cont'd)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 477px; height: 585px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A common way to determine a dietary phosphorus limit is to use an average of 10-12 mg/g of protein (multiply protein goal times 10-12 mg phosphorus). Thus, for a 70 kg individual requiring 84 g of protein, the phosphorus range is 840-1008 mg.",
"    <br/>",
"    Considering all common sources of protein, the average phosphorus content per gram of protein is 17.8. If all diary products, nuts, beans, and seeds are eliminated, but meats and tofu are considered, the average phosphorus content per gram of protein is 10.3.",
"    <div class=\"footnotes\">",
"     FF: fast food; Tb: tablespoon.",
"    </div>",
"    <div class=\"reference\">",
"     US Department of Agriculture, Agricultural Research Service. 2001. USDA Nutrient Database for Standard Reference, Release 14. Nutrient Data Laboratory Home Page, file://www.nalusda.gov/fnic/foodcomp.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
