var title_f40_35_41531="Infant NVP dosing recommendations";
var content_f40_35_41531=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F65143&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F65143&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Extended simplified infant nevirapine dosing recommendations*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Infant age",
"       </td>",
"       <td class=\"subtitle1\">",
"        NVP daily dosing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Birth&bull; to 6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Birth weight 2000-2499 g",
"       </td>",
"       <td class=\"sublist_other\">",
"        10 mg twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Birth weight &gt;2500 g",
"       </td>",
"       <td class=\"sublist_other\">",
"        15 mg twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;6 weeks to 6 months",
"       </td>",
"       <td>",
"        20 mg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;6 months to 9 months",
"       </td>",
"       <td>",
"        30 mg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;9 months to end of breastfeeding",
"       </td>",
"       <td>",
"        40 mg once daily",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Based on the dosing required to sustain exposure in the infant of &gt;100 ng/ml with the least dose changes.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Low birth weight infants should receive mg/kg dosing; suggested starting dose is 2 mg/kg once daily. Therapeutic drug monitoring is recommended.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Mirochnick, M, et al. Nevirapine pharmacokinetics during the first year of life: a population analysis across studies in Pediatric Academic Society. 2006: San Francisco, USA. Reproduced with permission from: World Health Organization. Antiretroviral drugs for treating pregnant women and preventing HIV infection in infants: towards universal access: Recommendations for a public health approach (2010 version). World Health Organization, Geneva 2010. Copyright &copy; 2010 WHO. Available at:",
"     <a href=\"file://whqlibdoc.who.int/publications/2010/9789241599818_eng.pdf\">",
"      file://whqlibdoc.who.int/publications/2010/9789241599818_eng.pdf",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
